let self3 = this
self3.margin = {top: 10, right: 20, bottom: 30, left: 50};

var forceVis = d3.select("#spiderVis");

//Gets access to the div element created for this chart from HTML
self3.svgBounds = spiderVis.node().getBoundingClientRect();
self3.svgWidth = (self.svgBounds.width - self.margin.left - self.margin.right)/2;
self3.svgHeight = 500;


//creates svg element within the div
self3.svg = spiderVis.append("svg")
    .attr("width",self.svgWidth)
    .attr("height",self.svgHeight)


var nodes = []
var links = []
var artistNames = []

artistData.forEach(function(artist){
    nodes.push({"name": artist.name})
    artistNames.push(artist.name)
})

artistData.forEach(function(artist, index) {
    artist.relatedArtists.forEach(function(person){
        var target = artistNames.indexOf(person.name)
        if (target != -1) {
            links.push({"source": index, "target": target})
        }
    })

})
//console.log(links)
let data = {nodes, links}

var force;

force = d3.forceSimulation(data.nodes)
    .force("charge",d3.forceManyBody().strength(-5))
    .force("link",d3.forceLink(data.links).distance(40))
    .force("center",d3.forceCenter().x(self3.svgWidth/2).y(self3.svgHeight/2))
// 2a) DEFINE 'NODES' AND 'EDGES'

//Create edges as lines
var edges = self3.svg.selectAll("line")
    .data(data.links)
    .enter()
    .append("line")
    .style("stroke", "#ccc")
    .style("stroke-width", 1);
//Create nodes as circles
var nodes = self3.svg.selectAll("circle")
    .data(data.nodes)
    .enter()
    .append("circle")
    .attr("r", 7)
    .style("fill","crimson")


var test;
// 5) LISTEN TO THE 'TICK' EVENT AND UPDATE THE X/Y COORDINATES FOR ALL ELEMENTS
force.on("tick", ()=>{
    edges
        .attr("x1", (d)=>d.source.x)
        .attr("y1", (d)=>d.source.y)
        .attr("x2", (d)=>d.target.x)
        .attr("y2", (d)=>d.target.y)
    nodes
        .style("fill", function(d, i) {
        return "crimson"
    })
        .attr("cx", function(d) { return d.x = Math.max(7, Math.min(self3.svgWidth  - 7, d.x)); })
        .attr("cy", function(d) { return d.y = Math.max(7, Math.min(self3.svgHeight - 7, d.y)); });

})

const  dragstart = (event,d) =>{
    if (!event.active) force.alphaTarget(0.3).restart();
    d.fx = d.x;
    d.fy = d.y;
}

function drag(event,d) {
    d.fx = event.x;
    d.fy = event.y;
}

function dragend(event,d) {
    if (!event.active) force.alphaTarget(0);
    d.fx = null;
    d.fy = null;
}

nodes.call(d3.drag()
    .on("start", (event,d)=>dragstart(event,d))
    .on("drag", (event,d)=>drag(event,d))
    .on("end", (event,d)=>dragend(event,d)));

nodes.append("title")
    .text(function(d) { return d.name; });








